def _cython_agg_blocks(
        self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1
    ) -> "Tuple[List[Block], Index]":
        # TODO: the actual managing of mgr_locs is a PITA
        # here, it should happen via BlockManager.combine

        data: BlockManager = self._get_data_to_aggregate()

        if numeric_only:
            data = data.get_numeric_data(copy=False)

        _, agg_blocks, new_items, deleted_items, split_items, split_frames = self._aggregate_blocks(
            data, how, alt, min_count
        )

        # Ensure that either agg_blocks or split_frames have valid data to aggregate
        if not (agg_blocks or split_frames):
            raise DataError("No numeric types to aggregate")

        if split_items:
            # Clean up the mess left over from split blocks.
            new_items, agg_blocks = self._clean_up_split_blocks(split_items, split_frames, new_items, data, agg_blocks)

        agg_blocks, agg_items = self._finalize_ndarray_agg_results(agg_blocks, new_items, deleted_items, data)

        return agg_blocks, agg_items
